import React from 'react';
import {BrowserRouter , Route ,Link} from 'react-router-dom';

const PageOne = () => {
    return <div>
            PageOne
            <Link href ="/pagetwo" ></Link>
        </div>;
};

const PageTwo = () => {
    return <div>
        PageTwo
        <button>click me</button>
        </div>;
};

const App = () => {
    //performs routing
    return (
        <div>
            <BrowserRouter>
                <div>
                    <Route path = "/" exact component ={PageOne} />
                    <Route path = "/pageTwo" component ={PageTwo} />
                </div>   
            </BrowserRouter>
        </div>
    );
};

export default App;
